import unittest

from random import randint, shuffle
from sys import maxsize

class StressTest(unittest.TestCase):
  known_values = (
    # A[:],           expected
    ([-5,-1,-1,2,-2,-3],     [1,1,3,2,1,1]),
    ([1,2,3,4],           [1,1,1,1]),
    ([1,-5,1,-5],         [4,3,2,1]),

  )

  def test_known_cases(self):
    for A, expected in self.known_values:
      self.assertEqual(expected, NaiveSolution().altarray(A))

  def test_all_cases(self):
    while True:
      break
      N = randint(0, 10)
      A = [randint(-N, N) for x in range(N)]
      ans = NaiveSolution().altarray(A)
      print(A, ans)


class NaiveSolution:
  def altarray(self, A):
    dp = [1 for x in range(len(A))]
    for x in range(len(A)-2, -1, -1):
      if self.isAlter(A[x], A[x+1]):
        dp[x] = dp[x+1] + 1

    return dp

  def isAlter(self, a, b):
    if a > 0:
      return b < 0
    if b > 0:
      return a < 0
    return False


