import math
def intsqrt(x):
    n = int(x)
    if n==0:
        return 0
    a,b = divmod(n.bit_length(),2)
    x = 1<<(a+b)
    while True:
        y = (x + n//x)//2
        if y>=x:
            return x
        x = y

def isFibonacci(n):
    sq = 5*(n*n)+4
    if (((intsqrt(sq)*intsqrt(sq))-sq)==0):
        return True
    else:
        sq-=8
        if (((intsqrt(sq)*intsqrt(sq))-sq)==0):
            return True
        else:
            return False


