    x = n
    y = (x + 1) // 2
    while y < x:
        x = y
        y = (x + n // x) // 2
    return x
def isSq(n):
    s=isqrt(n)
    return s*s==n
def isFib(n):
    return isSq(n*n*5+4) or isSq(n*n*5-4)
