def main():
    def GCD(a,b):
        if b==0:
            return a
        elif a==0:
            return b
        elif a%2==b%2==0:
            return 2*GCD(a//2,b//2)
        elif a%2==0:
            return GCD(a//2,b)
        elif b%2==0:
            return GCD(a,b//2)
        else:
            if a>b:
                return GCD(a%b,b)
            else:
                return GCD(b%a,a)
    for i in range(int(input())):
