def masking(bits,n):
    a=1<<(n-1)
    ret=0
    mask=1
    i=0
    while(i<=(n-1)):
        mask=1<<i
        a=1<<(n-i-1)
        if((bits)&(mask)):
            ret=ret|a
        i+=1
    return(ret)

