import sys

def array_transform():
    T = int(sys.stdin.readline())
    for k in range(T):
        l = sys.stdin.readline().split()
        n = int(l[0])
        k = int(l[1])
        l = sys.stdin.readline().split()
        A = sorted([ int(c) for c in l ])
        if n == 2:
            print("YES")
        else:
            comp_num = 0
            comp_sizes = []
            visited = [ 0 for i in range(n) ]
            while comp_num <= 2:
                j = -1
                for i in range(n):
                    if visited[i] == 0:
                        j = i
                        break
                if j == -1:
                    break
                else:
                    comp_num += 1
                    size = 0
                    for i in range(j,n):
                        if (A[i]-A[j]) % (k+1) == 0:
                            visited[i] = 1
                            size += 1
                    comp_sizes.append(size)
            if comp_num > 2:
                print("NO")
            elif comp_num == 1:
                print("YES")
            else:
                if comp_sizes[0] == 1 or comp_sizes[1] == 1:
                    print("YES")
                else:
                    print("NO")

def main():
    array_transform()

