def find(v, u):
    if v == u[v]:
        return v
    return find(u[v], u)

def union(u, v, uf):
    uf[find(v, uf)] = find(u, uf)

def solve_c(n, m, arr):
    setsmap = [0 for i in range(n)]
    union_find = [i for i in range(n)]
    for set_index, s_arr in enumerate(arr):
        for val in s_arr:
            setsmap[val] |= (1 << set_index)
    for i in range(n):
        for j in range(i+1,n):
            if setsmap[i] == setsmap[j]:
                union(i, j, union_find)
    count = 0
    for i in range(n):
        if union_find[i] == i:
            count += 1
    return count

