def CoprimeCount(fact,x):
  k=len(fact)
  Net=1<<k
  ans=0
  for mask in range(Net):
    cnt=0
    val=1
    for i in range(k):
      if ((1<<i) & mask) != 0:
        val*=fact[i]
        #print(fact[i],end=" | ")
        cnt+=1
    if cnt&1==1:
      ans-=x//val
    else:
      ans+=x//val
  #print("Number of Relative Primes with ",x," are ",ans)
  return ans


