def solve(n, u, v):
    ub, vb = bin(u)[2:], bin(v)[2:]
    #ub, vb, nb = bin(u)[2:], bin(v)[2:], bin(n)[2:]
    i = 0
    while i < len(ub) and i < len(vb) and ub[i] == vb[i]:
        i += 1
    return min(limit(n, ub[i:]), limit(n, vb[i:]))


def limit(n, sufix):
    if sufix == '':
        return n
    nb = bin(n)[2:]
    k = len(sufix)
    ns = nb[-k:]
    if sufix == ns or int(sufix, 2) < int(nb[-k:], 2):
        return int(nb[:-k], base=2)
    else:
        lb = nb[:-k]
        return int(lb, base=2) - 1


