def runCase(numbers):
  """ Count the number of sub lists where the sum of all numbers is equal to the product """
  count = 0
  length = len(numbers)
  for start in range(0, length):
    for end in range(start + 1, length + 1):
      sublist = numbers[start:end]
      if listSum(sublist) == listProd(sublist):
        count += 1
  return count



def listSum(array):
  """ Get the sum of each item in an list of numbers """
  result = 0;
  for val in array:
    result += int(val)
  return result



def listProd(array):
  """ Get the product of each item in a list of numbers """
  count = len(array)
  if not count:
    return 0
  result = int(array[0])
  for i in range(1, count):
    result *= int(array[i])
  return result



