def com(a,b):
    if b >= 0 and a >= 0:
        if b > a:
            return 0
        if a == b:
            return 1
        if b == 0:
            return 1
        r = max(b,a-b)
        up = down = 1
        for i in range(r+1,a+1):
            up *= i
        for i in range(1,a-r+1):
            down *= i
        return up//down
