def n_moves(h):
    if len(h) <= 1:
        return 0

    current = [x for x in extremes(h)]
    moves = 0
    while len(current) > 1:
        if current[0] > current[1]:
            moves += current[0] - current[1]
            current = current[1:]
        elif len(current) == 2:
            moves += current[1] - current[0]
            current = []
        elif len(current) == 3:
            moves += current[1] - min(current[0], current[2])
            current = []
        elif current[0] < current[2]:
            moves += current[1] - current[2]
            current = [current[0]] + current[3:]
        else:
            moves += current[1] - current[2]
            current = current[2:]
    return moves


def extremes(h):
    mode = 0 # -1 is decreasing, 1 is increasing, 0 is no changes yet
    last = h[0]
    for hi in h[1:]:
        if hi < last and mode != -1:
            yield last
            mode = -1
        elif hi > last and mode != 1:
            yield last
            mode = 1
        last = hi
    yield last

