def isCielNum(N):
    cnt3 = 0
    cnt5 = 0
    cnt8 = 0
    if(N == 0):
        return False
    while(N > 0):
        r = N % 10
        if(r != 3 and r != 5 and r != 8):
            return False
        if(r == 3):
            cnt3 += 1
        elif(r == 5):
            cnt5 += 1
        else:
            cnt8 += 1
        N //= 10
    return (cnt3 <= cnt5) and (cnt5 <= cnt8)
