import sys

class Entity:
  def __init__(self, x, y, dir):
    self.x = x
    self.y = y
    self.dir = dir

  def simulate(self, time):
    if self.dir == 'U':
      self.y += time
    elif self.dir == 'D':
      self.y -= time
    elif self.dir == 'L':
      self.x -= time
    elif self.dir == 'R':
      self.x += time

  #Returns sys.float_info.max if the collision does not take place
  def collision_time(self, other):
    dist_x = abs(self.x - other.x)
    dist_y = abs(self.y - other.y)
    dist = dist_x + dist_y
    self.simulate(0.5)
    other.simulate(0.5)
    cur_dist_x = abs(self.x - other.x)
    cur_dist_y = abs(self.y - other.y)
    cur_dist = cur_dist_x + cur_dist_y
    self.simulate(-0.5)
    other.simulate(-0.5)
    if (cur_dist < dist) and (self.x == other.x or self.y == other.y):
      return max(dist_x / 2.0, dist_y / 2.0)
    elif ((dist_x == dist_y)
        and (cur_dist_x < dist_x and cur_dist_y < dist_y)):
      return dist_x
    return sys.float_info.max

