    asteroid = Entity(float(line[0]), float(line[1]), line[2])
    earliest_time = min(earliest_time, earth.collision_time(asteroid))
  if earliest_time == sys.float_info.max:
    print('SAFE')
  else:
    print('%.1f' % earliest_time)

