def hor(x, y):
    if (y % 2 == 1):
        return False
    return (y <= 0 and y <= x <= -y + 1) or (y > 0 and -y <= x <= y - 1)
def ver(x, y):
    if (x < 0 and x % 2 == 1) or (x > 0 and x % 2 == 0):
        return False
    return (x <= 0 and x <= y <= -x) or (x > 0 and -x + 1 <= y <= x + 1)

