def fromX(x, y):
    if (x % 2 == 0 and x > 0) or (x % 2 == 1 and x < 0):
        return False
    if x % 2 == 0: # x <= 0
        return x <= y <= -x
    else:
        return -x + 1 <= y <= x + 1
def fromY(x, y):
    if y % 2 == 1:
        return False
    if y <= 0:
        return y <= x <= -y + 1
    else:
        return -y <= x <= y - 1

