import sys

class Node: # TODO: balanced tree
        def __init__(self, key, value, left = None, right = None):
                self.key = key
                self.value = value
                self.left = left
                self.right = right

        def __str__(self):
                return "Node(%d):%d" % (self.key, self.value)

        @staticmethod
        def find(root, key):
                node = root
                while True:
                        if key == node.key: return node
                        elif key < node.key:
                                if node.left == None: return node
                                node = node.left
                        else:
                                if node.right == None: return node
                                node = node.right

        @staticmethod
        def insert(root, key, value):
                if root == None:
                        root = Node(key, value)
                node = Node.find(root, key)
                if key == node.key:
                        return root
                new_node = Node(key, value)
                if key < node.key:
                        node.left = new_node
                else:
                        node.right = new_node
                return root

        @staticmethod
        def inorder(node):
                if node.left != None: yield from Node.inorder(node.left) # Python 3.3
                yield node
                if node.right != None: yield from Node.inorder(node.right)

