import os


def to_bin(num):
    str = bin(num)
    return (str.count('1'))


def get_res(n, a, b):
    an = to_bin(a)
    bn = to_bin(b)
    all = an + bn
    if all > n:
        all -= (all - n) * 2
    stro = ''
    for i in range(all):
        stro += '1'
    for i in range(n - all):
        stro += '0'
    return (int(stro, 2))


def main():
    T = int(input(''))
    for i in range(T):
        (n, a, b) = tuple(input('').split(' '))
        print(get_res(int(n), int(a), int(b)))


