def numof1(a):
  count = 0
  for x in a:
    if(x==1):
      count+=1
  return count

def binary(a,n):
  ans = []
  while a!=0:
    ans.append(a&1)
    a>>=1
  temp = []
  for x in range(n-len(ans)):
    temp.append(0)
  return temp+ans

