import sys

def quick_sort(values):
    if len(values) <= 1:
        return values

    pivot = values[int(len(values)/2)]

    less_than = []
    equal = []
    greater_than = []

    for item in values:
        if item < pivot:
            less_than.append(item)
        elif item == pivot:
            equal.append(item)
        else:
            greater_than.append(item)

    return quick_sort(less_than) + equal + quick_sort(greater_than)

