def merge(l,min,mid,max):
    l1=l[min:mid+1]
    r=l[mid+1:max+1]
    i=min
    j=mid+1
    while(i<=mid and j<=max):
        if(l1[i-min]<=r[j-(mid+1)]):
            l[i+j-(mid+1)]=l1[i-min]
            i+=1
        else:
            l[i+j-(mid+1)]=r[j-(mid+1)]
            j+=1
    if(i==mid+1):
        while(j<=max):
            l[j]=r[j-(mid+1)]
            j+=1
    if(j==max+1):
        while(i<=mid):
            l[i+j-(mid+1)]=l1[i-min]
            i+=1
def partition(l,min,max):
    if(min<max):
        mid=(min+max)//2
        partition(l,min,mid)
        partition(l,mid+1,max)
        merge(l,min,mid,max)
