def mergeSort(A,n):
  if n==1:
    return A
  t1=A[0:(n//2)]
  t2=A[(n//2):n]
  t1=mergeSort(t1,(n//2))
  t2=mergeSort(t2,(n-n//2))
  i=j=0
  merged=[]
  for k in range(0,n):
    if i==len(t1) and j<len(t2):
      merged.append(t2[j])
      j+=1
    elif j==len(t2) and i<len(t1):
      merged.append(t1[i])
      i+=1
    elif t1[i]<t2[j]:
      merged.append(t1[i])
      i+=1
    else:
      merged.append(t2[j])
      j+=1

  return merged

