    less = []
    equal = []
    greater = []
    if len(l)>1:
        pivot = l[0]
        for x in l:
            if x< pivot:
                less.append(x)
            if x==pivot:
                equal.append(x)
            if x>pivot:
                greater.append(x)

        return qSort(less) + equal + qSort(greater)
    else:
        return l
if __name__=='__main__':
    print('\n'.join(str(my) for my in qSort(N)))

