def permute(a,l,r):
    if(l==r):
        if(a[0]/a[1])==(a[2]/a[3]):
            return True
    else:
        for i in range(l,r+1):
            a[l],a[i]=a[l],a[i]
            if(permute(a,l+1,r)):
                return True
            else:
                a[l],a[i]=a[i],a[l]
    return False

