def dec_to_bin(x):
    return int(bin(x)[2:])
for i in range(int(input())):
        n,a,b=map(int,input().split())
        l1=[int(i) for i in str(dec_to_bin(a))]
        l2=[int(i) for i in str(dec_to_bin(b))]
        while len(l1)!=n:
                l1.insert(0,0)
        while len(l2)!=n:
                l2.insert(0,0)
        x=min(l1.count(1),l2.count(0))
        y=min(l1.count(0),l2.count(1))
        p=x+y
        ans=[1]*p
        while len(ans)!=n:
                ans.append(0)
        res=0
        for i in range(n-1,-1,-1):
          res+=ans[n-1-i]*pow(2,i)
        print(res)

def getCountOfOnes(x):
    count = 0
    while x:
        if x%2 == 1:
            count = count + 1
        x = x//2
    return count

ip = []
for i in range(int(input())):
