    ca = getCountOfOnes(a)
    cb = getCountOfOnes(b)
    if ca > cb:
        cb = n - cb
    else:
        ca , cb = cb, ca
        cb = n - cb
    cn = abs(ca - cb)
    temp = ''
    for i in range(n-cn):
        temp = temp + '1'
    for i in range(cn):
        temp = temp + '0'

    print(int(temp,2))

