    x, y = map(int, input().split())
    x += tempx
    y += tempy
    win = x - y
    if win > 0:
        sheet['p1'] = max(sheet['p1'], win)
    else:
        sheet['p2'] = max(sheet['p2'], abs(win))
    tempx = x
    tempy = y
    t -= 1
