def main():
    player1 = {'cscore': 0, 'highest_score': 0}
    player2 = {'cscore': 0, 'highest_score': 0}

    t = int(input())

    for i in range(t):
        scores = input().split(' ')
        player1['cscore'] += int(scores[0])
        player2['cscore'] += int(scores[1])


        if player1['cscore'] - player2['cscore']  > 0:
            score = player1['cscore'] - player2['cscore']
            if score > player1['highest_score']:
                player1['highest_score'] = score
        elif player2['cscore'] - player1['cscore'] > 0:
            score = player2['cscore'] - player1['cscore']
            if score > player2['highest_score']:
                player2['highest_score'] = score

    if player1['highest_score'] > player2['highest_score']:
        print(1, player1['highest_score'])
    else:
        print(2, player2['highest_score'])

main()

